(2, 1, 'La promesse djihadiste vient remplacer pour certains la promesse occidentale qui ne fonctionne plus', 'test', '', '![](/storage/app/media/ixchel.jpg)\r\nPhoto : Ayoub Benkarroum\r\n\r\n**Wael Garnaoui est psychologue et doctorant à l\'université Paris VII Diderot. Il mène une recherche sur les candidats tunisiens à la migration et au djihad. Entretien.**\r\n\r\n**Vous avez effectué une série d\'entretiens avec des jeunes candidats à la migration, mais aussi candidats au djihad. Qu\'est-ce qui vous a conduit à eux ?**\r\n\r\nLire l\'article complet  :[ L\'humanité](http://www.humanite.fr/la-promesse-djihadiste-vient-remplacer-pour-certains-la-promesse-occidentale-qui-ne-fonctionne-plus)', '<p><img src="/storage/app/media/ixchel.jpg" alt="" />\nPhoto : Ayoub Benkarroum</p>\n<p><strong>Wael Garnaoui est psychologue et doctorant à l\'université Paris VII Diderot. Il mène une recherche sur les candidats tunisiens à la migration et au djihad. Entretien.</strong></p>\n<p><strong>Vous avez effectué une série d\'entretiens avec des jeunes candidats à la migration, mais aussi candidats au djihad. Qu\'est-ce qui vous a conduit à eux ?</strong></p>\n<p>Lire l\'article complet  :<a href="http://www.humanite.fr/la-promesse-djihadiste-vient-remplacer-pour-certains-la-promesse-occidentale-qui-ne-fonctionne-plus"> L\'humanité</a></p>', '2017-06-30 14:59:56', 1, '2017-06-30 15:00:16', '2017-06-30 16:26:40', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 1, 'des centaines de familles souffrent du mystère des clandestins disparus', 'article-jeune-afrique-1', '', '![Des migrants en provenance de Tunisie attendent d\'être contrôlés à Lampedusa, en Italie, le 14 février 2011](/storage/app/media/article-jeune-afrique-1.jpg)\r\n© Daniele La Monaca/AP/SIPA\r\n\r\n**Six ans que ces Tunisiens ont disparu. Six ans que leurs familles attendent, entourées des portraits de leurs hommes partis en mer, d’articles de journaux soigneusement découpés et rangés, de souvenirs devenus si douloureux. Six ans qu’elles espèrent non plus vraiment un signe de vie, mais au moins des réponses à leurs questions.**\r\n\r\nLire l\'article complet : [ Jeune afrique ](http://www.jeuneafrique.com/417847/societe/tunisie-centaines-de-familles-souffrent-mystere-clandestins-disparus/)', '<p><img src="/storage/app/media/article-jeune-afrique-1.jpg" alt="Des migrants en provenance de Tunisie attendent d\'être contrôlés à Lampedusa, en Italie, le 14 février 2011" />\n© Daniele La Monaca/AP/SIPA</p>\n<p><strong>Six ans que ces Tunisiens ont disparu. Six ans que leurs familles attendent, entourées des portraits de leurs hommes partis en mer, d’articles de journaux soigneusement découpés et rangés, de souvenirs devenus si douloureux. Six ans qu’elles espèrent non plus vraiment un signe de vie, mais au moins des réponses à leurs questions.</strong></p>\n<p>Lire l\'article complet : <a href="http://www.jeuneafrique.com/417847/societe/tunisie-centaines-de-familles-souffrent-mystere-clandestins-disparus/"> Jeune afrique </a></p>', '2017-06-30 16:50:14', 1, '2017-06-30 16:50:00', '2017-06-30 16:50:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 1, 'Article autour du livre "le journal de Razi"', 'akhbar-alrazy', '', '![](/storage/app/media/aymen-dabbousi.jpg)\r\nRafik Majdoub - Liban\r\n\r\n#### **Aymen dabbousi**\r\nLire l\'article complet :[Al safir - Liban](http://arabi.assafir.com/Article/3580)', '<p><img src="/storage/app/media/aymen-dabbousi.jpg" alt="" />\nRafik Majdoub - Liban</p>\n<h4><strong>Aymen dabbousi</strong></h4>\n<p>Lire l\'article complet :<a href="http://arabi.assafir.com/Article/3580">Al safir - Liban</a></p>', '2017-06-30 17:08:41', 1, '2017-06-30 17:08:32', '2017-06-30 18:42:09', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 1, 'Nouvelle parution "Les Nouvelles de Razi" de Aymen Dabussi', 'asdarat-gdyd-roay-akhbar-alrazy-laymn-aldbosy', '', '![](/storage/app/media/n.jpg)', '<p><img src="/storage/app/media/n.jpg" alt="" /></p>', '2017-06-30 18:38:38', 1, '2017-06-30 18:39:53', '2017-06-30 18:39:53', NULL, NULL, NULL, NULL, NULL, NULL, NULL);

